import React, { useEffect, useState } from 'react'
import Navbar from '../components/Navbar'
import Project from '../components/Project'

function MyWork(){

  useEffect( async () => {
     try{
       const unparsed = await fetch("../highlated.json")
      const data = await JSON.parse(unparsed)
      console.log(data)
     }catch( err){
      console.error(err)
     }
  }, [])

  return (
    <>
      <Navbar class="myWorkNav" />
    <div className='projects'>

    </div>
    </>
  )
}

export default MyWork
